Accounts_CustomFields_Description:
應該是有效的JSON，其中鍵是包含字段設置字典的字段名稱。例如：<br/><code>{
“角色”：{
“type”：“select”，
“defaultValue”：“學生”，
“選項”：[“老師”，“學生”]，
“required”：是的，
“modifyRecordField”：{
“數組”：是的，
“字段”：“角色”
}
}，
“推特”： {
“type”：“text”，
“required”：是的，
“minLength”：2，
“maxLength”：10
}
}</code>

Custom_Translations_Description:
應該是有效的JSON，其中鍵是包含鍵和翻譯字典的語言。例如：<br/><code>{
“en”：{
“頻道”：“房間”
}，
“pt”：{
“頻道”：“薩拉斯”
}
}</code>
